    false,nt"url": null,nt"notes": "nThis data contains Upward Looking Sonar
    (ULS) profiles of the underside of the Arctic pack ice along three transects whose
    total length is 777 nautical miles. The data were obtained by the USS Gurnard (SSN-662),
    a U.S. Navy submarine, on a traverse of the AIDJEX Main Experiment area in the Beaufort
    Sea from 07 April 1976 to 10 April 1976. The sea ice thickness derived from the
    ULS is given in feet.The data are in a single ASCII text file: Aidjex_04_1976_uls.txt.
    The data in this text file are not formatted into columns; all data are presented
    in one long row separated by spaces. Little is known about the format of the file,
    so caution should be used when working with the data. NSIDC is providing this data
    as part of our effort to preserve historical data.  The data file begins with nine
    values that appear to be header information. These nine values include latitude
    and longitude values along with other unknown values. After the header, there are
    approximately 2100 measurements of what NSIDC believes is sea ice thickness in feet,
    however it is unclear how often these measurements were taken. After these 2100
    values, another header of nine values occurs followed again by 2100 measurements.
    The file continues in this pattern through the remainder of the file. Users with
    information about the contents of the file are encouraged to contact <a href="mailto:nsidc.org">NSIDC
    User Services</a>.Two supporting documents that provide some background have been
    scanned and included as PDF files. These are AIDJEX_ULS_background.pdf and AIDJEX_ULS_format.pdf.These
    data are available via FTP.<strong>Note:</strong> These data are in a raw format
    with unknown fields and are being provided as is for preservation purposes. A processed
    version of the data are available in the <a href="/data/g01360.html">Submarine
    Upward Looking Sonar Ice Draft Profile Data and Statistics</a> data set.n",nt"license_title":
